            <Cards
              title={res.item.title}
              price={res.item.price}
              image={res.item.images}
              id={res.item.id}
            ></Cards>
          ))
        : data.map((res) => (
            <Cards
              title={res.title}
              price={res.price}
              image={res.images}
              id={res.id}
            ></Cards>
          ))}
    </div>
  );
}

export default Products;
